import React
 ,{useState,
  useEffect} 
from 'react';
// reactstrap components
import {
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    Table,
    Row,
    Col,
  } from "reactstrap";
import {
     Link
    //, useNavigate 
} 
    from "react-router-dom";
import axios from 'axios';

function Admins() {
    // eslint-disable-next-line
  // const [sucess,setSucess] =useState()
  // const navigate = useNavigate();
const [users,setUsers] =useState([])
  axios.defaults.withCredentials = true;
  useEffect(() => {
    axios.get('http://localhost:3001/super-admin/admins')
      .then(users => setUsers(users.data))
      .catch(err=> console.log(err))
  }, []);
    const scrollbarStyles = {
        WebkitOverflowScrolling: 'touch', // Optional: Improve scrolling smoothness      
      };
  return (
   <>
    <div className="content">
        <Row>
          <Col md="12">
            <Card>
              <CardHeader>
                <CardTitle tag="h4">Admins Operating</CardTitle>
              </CardHeader>
              <CardBody>
                <Table style={scrollbarStyles} responsive>
                  <thead className='tableHead'>
                    <tr>
                      <th>Admin ID</th>
                      <th>Admin Name</th>
                      <th>Acess</th>
                      <th className="">Operation</th>
                    </tr>
                  </thead>
                  <tbody>
                    {
                      users.map(user=>{
                       return <tr>
                          <td>{user.id}</td>
                          <td>{user.name}</td>
                          <td>All</td>
                          <td style={{display:'flex'}}>
                            <Link to="/super-admin/admins/edit" className="nav-link btn-rotate">
                              <i style={{fontSize:20}} class="fa-solid fa-pen-to-square text-secondary edeButton"></i>
                            </Link>
                              <span style={{fontSize:22}}> || </span>
                            <Link to="/super-admin/admins/delete" className="nav-link btn-rotate">
                                <i style={{fontSize:20}} class="fa-solid fa-trash text-danger edeButton"></i> 
                            </Link>
                            </td>
                        </tr>
                      })
                    }
                  </tbody>
                </Table>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
      {/*  */}
   </>
  )
}

export default Admins;
